  Code = "class Solution:\n    def countBeautifulPairs(self, nums: List[int]) -> int:\n        def check(num1: int, num2: int) -> bool: \n            first, last = 0, num2 % 10\n            while num1 > 0:\n                first = num1 % 10\n                num1 //= 10\n            return math.gcd(first, last) == 1\n        res = 0\n        for i in range(len(nums)):\n            for j in range(i + 1, len(nums)):\n                if check(nums[i], nums[j]):\n                    res += 1\n        return res"
